import React from 'react';
import '../App.css'
import Button from 'react-bootstrap/Button';
import {HomeScreen} from './HomeScreen.js'
import {AboutScreen} from './AboutScreen.js'
import {ProjectsScreen} from './ProjectsScreen.js'
import {ProgressScreen} from './ProgressScreen.js'
import { ProjectAccendre } from './projects/ProjectAccendre.js';
import {Contact} from './Contact.js'

import { Sidebar } from './Sidebar';


export function MainScreen(props) {

    const [curr, changePage] = React.useState(props.page)
    const pages = {
        'home': () => <HomeScreen />,
        'about': () => <AboutScreen />,
        'projects': () => <ProjectsScreen />,
        'progress': () => <ProgressScreen />, 
        'projects/accendre' : () => <ProjectAccendre />
    }
    return (
        <div
        className = 'mainScreen'
        >
            <Sidebar />
            { /*
            { (props.page == 'home') ? <HomeScreen /> : 
             ((props.page == 'about') ? <AboutScreen /> : 
             ((props.page == 'projects' ? <ProjectsScreen /> : 
             ((props.page == 'progress') ? <ProgressScreen /> : <Contact />))))  }
    */}

            {pages.curr}

        </div>



        );

}
